import { httpService } from '.';
import { apiUrl } from '../config';
const baseUrl= `${apiUrl}/users/password`

export const passwordSerivce = {
    forget,reset
}
async function forget(email){
    return httpService.post(`${baseUrl}/forget`,{email});

}

async function reset(body){
    return httpService.put(`${baseUrl}/reset`,body);
}
